INSERT INTO `ib_posts` (`postid`, `type`, `parentid`, `categoryid`, `catidpath1`, `catidpath2`, `catidpath3`, `acount`, `amaxvote`, `selchildid`, `closedbyid`, `userid`, `cookieid`, `createip`, `lastuserid`, `lastip`, `upvotes`, `downvotes`, `netvotes`, `lastviewip`, `views`, `hotness`, `flagcount`, `format`, `created`, `updated`, `updatetype`, `title`, `content`, `tags`, `name`, `notify`) VALUES
(1, 'Q', NULL, 1, 1, NULL, NULL, 1, 0, NULL, NULL, 1, NULL, 2130706433, NULL, NULL, 0, 0, 0, NULL, 10, 30654500000, 0, 'html', '2014-11-08 15:33:49', NULL, NULL, 'A mobile studio/device for artists', '<p>\n	<span id="j_id0:SiteTemplate:j_id38"><span id="j_id0:SiteTemplate:j_id39"><span id="j_id0:SiteTemplate:j_id39:Idea2IdeaAndComments:j_id41"><span id="j_id0:SiteTemplate:j_id39:Idea2IdeaAndComments:j_id41:Idea2Idea:IdeaContentPanel">I want the best touch mobile device that is compatible with the best digitizer accessories (namely, wacom). As a 20 year graphic designer and front-end developer, I have come to love and trust wacom for the best pens and tablets. The last 5+ years I have migrated into UI/UX and my job is to constantly make fast notes and wireframes, quick design drawings, and instant prototypes. I have not found a mobile device that could get me off paper and into a digital studio without a lot of file and hard drive swapping. I was looking at the XPS ultrabook as just the best idea, being a tablet for drawing, and a laptop for my design and dev applications. The biggest reason I wont purchase one right away is that it is not compatible with my trusty wacom pen. I have a bamboo stylus touch, the best stylus on the market. Some tablets will work with the bamboo but these dont feature windows 8.1 or the ability to double as a laptop. I want one device, mobile, touch and cpu, to be everything I need and I believe there is an army of users like me who are waiting for the same device. </span></span></span></span></p>', 'mobile,-,artist', NULL, '@'),
(2, 'A', 1, 1, 1, NULL, NULL, 0, 0, NULL, NULL, NULL, 4230912513621119232, 2130706433, NULL, NULL, 0, 0, 0, NULL, 0, NULL, 0, '', '2014-11-09 00:09:42', NULL, NULL, NULL, 'Test the answer', NULL, '', NULL),
